pragma solidity ^0.8.24;

contract Hostel{

    address payable tenant;
    address payable landlord;

    uint public no_of_rooms = 0;
    uint public no_of_agreement = 0;
    uint public no_of_rent = 0;

    struct Room{
        uint roomid;
        uint agrrementid;
        string roomname;
        uint rent_per_month;
        uint securityDeposit;
        uint timestamp;
        bool vacant;
        address payable landlord; 
        address payable currentTenant; 
    }
    
}

